import React, { Component } from "react";


class Header extends Component
{
    render ()
    {
        return (
            <div className="container">
                <nav className="navbar fixed-top navbar-dark bg-dark">
                    <h1 >Teams</h1>
                </nav>
            </div>
        );
    }
}

export default Header;
